(window.webpackJsonp=window.webpackJsonp||[]).push([[902],{1139:function(e){e.exports={content:'<ul>\n<li>\u7ed9\u8868\u6dfb\u52a0\u522b\u540d(M\u662fmovies\u7684\u522b\u540d,T\u662ftitle\u7684\u8f93\u51fa\u540d)</li>\n</ul>\n<p><code>SELECT title as T FROM movies M;</code></p>\n<ul>\n<li>\u6dfb\u52a0row</li>\n</ul>\n<p><code>INSERT INTO library VALUES (1,\'javascript\',8);</code></p>\n<ul>\n<li>\u6761\u4ef6\u6392\u5e8forder by</li>\n</ul>\n<p><code>SELECT * FROM movies WHERE release_year&gt;1999 ORDER BY release_year;</code></p>\n<ul>\n<li>SUM</li>\n</ul>\n<p><code>SELECT SUM(minutes) FROM todo_list;</code></p>\n<ul>\n<li>\u5d4c\u5957in</li>\n</ul>\n<p><code>SELECT title FROM songs WHERE artist IN ( SELECT name FROM artists WHERE genre=&quot;Pop&quot;);</code></p>\n<ul>\n<li>like</li>\n</ul>\n<pre class="hljs"><code>SELECT * FROM exercise_logs\n WHERE type IN (\n    SELECT type FROM drs_favorites \n    WHERE reason LIKE &quot;%cardiovascular%&quot;\n    );\n</code></pre>\n<ul>\n<li>\u591a\u91cd\u6761\u4ef6\u9009\u62e9case...when..then</li>\n</ul>\n<pre class="hljs"><code>SELECT Count(*),\n    CASE \n        WHEN number_grade&gt;90 THEN &quot;A&quot;\n        WHEN number_grade&gt;80 THEN &quot;B&quot;\n        WHEN number_grade&gt;70 THEN &quot;C&quot;\n        ELSE &quot;F&quot;\n    END AS &quot;letter_grade&quot;\n    FROM student_grades \n    GROUP BY letter_grade;\n</code></pre>\n<ul>\n<li>as\u522b\u540d group by...having</li>\n</ul>\n<pre class="hljs"><code>SELECT author ,AVG(words) AS avg_words FROM books \n    GROUP BY author\n    HAVING avg_words &gt;150000;\n\n</code></pre>\n<ul>\n<li>and\u4e14</li>\n</ul>\n<pre class="hljs"><code>SELECT persons.name,hobbies.name FROM persons\nJOIN hobbies\nWHERE persons.name=\'Bobby McBobbyFace\'\nAND persons.id=hobbies.person_id;\n</code></pre>\n<ul>\n<li>not in(A.id\u4e0d\u5b58\u5728\u4e8eB.CustomerId\u4e2d\u7684\u6570\u636e)</li>\n</ul>\n<pre class="hljs"><code>SELECT Name from Customers A\nWHERE A.Id NOT IN (SELECT B.CustomerId from Orders B)\n</code></pre>\n<ul>\n<li>not exist</li>\n</ul>\n<pre class="hljs"><code>SELECT A.Name from Customers A\nWHERE NOT EXISTS (SELECT 1 FROM Orders B WHERE A.Id = B.CustomerId)\n</code></pre>\n<ul>\n<li>left out join...on\u5408\u5e76\u8868\u5e76\u4e14\u5de6\u8fb9\u5168\u90e8\u5408\u5e76\u663e\u793a</li>\n</ul>\n<pre class="hljs"><code>SELECT customers.name, customers.email, SUM(orders.price) AS total_price\nFROM customers \nLEFT OUTER JOIN orders\nON orders.customer_id=customers.id\nGROUP BY customers.id\nORDER BY total_price desc;\n</code></pre>\n<ul>\n<li>\u5408\u5e76\u5f53\u524d\u8868 left outer join xxx \u522b\u540d</li>\n</ul>\n<pre class="hljs"><code>/* join itself */\nSELECT movies.title, sequel.title AS sequel_title\nFROM movies\nLEFT OUTER JOIN movies sequel\nON movies.sequel_id=sequel.id;\n</code></pre>\n<ul>\n<li>\u591a\u91cd\u5408\u5e76</li>\n</ul>\n<pre class="hljs"><code>/* multiple joins*/\nSELECT a.fullname, b.fullname FROM friends\nJOIN persons a\nON a.id=friends.person1_id\nJOIN persons b\nON b.id=friends.person2_id;\n</code></pre>\n<ul>\n<li>\u66f4\u65b0\u5185\u5bb9update</li>\n</ul>\n<pre class="hljs"><code>UPDATE documents SET author=\'Jackie Draper\'\nWHERE author=\'Jackie Paper\';\n</code></pre>\n<ul>\n<li>\u5220\u9664\u5185\u5bb9</li>\n</ul>\n<p><code>DELETE FROM documents WHERE title=&quot;Things I\'m Afraid Of&quot;;</code></p>\n<ul>\n<li>\u589e\u52a0\u8868\u7684\u5217\uff0c\u6539\u53d8\u8868\u7ed3\u6784</li>\n</ul>\n<p><code>ALTER TABLE clothes ADD COLUMN price INTEGER;</code></p>\n<ul>\n<li>\u53d8\u66f4\u8868\u540d</li>\n</ul>\n<p><code>ALTER TABLE travel_spots RENAME TO places_to_live;</code></p>\n'}}}]);
